import React from 'react';

function Header() {
  return (
    <div>
      <header>
        <nav className="navBar">
          <a className="navLink" href="/">
            Employee Directory
          </a>
          <a
            className="navLink"
            href="https://github.com/mtbishop/Employee-Directory"
          >
            Repository
          </a>
        </nav>
      </header>
    </div>
  );
}

export default Header;
